class Solution {
    public long minSum(int[] nums1, int[] nums2) {
        long sum1 = 0, sum2 = 0;
        for (int num : nums1) {
            sum1 += num;
        }
        for (int num : nums2) {
            sum2 += num;
        }
        int zerosInNums1 = 0, zerosInNums2 = 0;
        for (int num : nums1) {
            if (num == 0) zerosInNums1++;
        }
        for (int num : nums2) {
            if (num == 0) zerosInNums2++;
        }
        long totalZeros = zerosInNums1 + zerosInNums2;
        if (totalZeros == 0) {
            return sum1 == sum2 ? sum1 : -1;
        }
        long maxSum = Math.max(sum1, sum2);
        long minSum = Math.min(sum1, sum2);
        long diff = maxSum - minSum;
        if (diff == 0) {
            return maxSum + totalZeros;
        }
        if (diff > totalZeros - 1) {
            return -1;
        }
        return maxSum + (totalZeros - diff);
    }
}
